import React from 'react';

function EliminarPlanillaMensual() {
  return (
    <div>
      <h2>Eliminar Planilla Mensual</h2>
      <p>Aquí irá la interfaz para eliminar una planilla mensual existente.</p>
    </div>
  );
}

export default EliminarPlanillaMensual;
